import React from "react";
import { Container, Button, Row, Col, Image } from "react-bootstrap";
import { Link } from "react-router-dom";

const Page = () => {
  return (
    <Container className="text-center mt-5">
      <Row className="align-items-center">
        <Col md={6} className="text-md-start text-center mb-4">
          <h1 className="fw-bold">Find Your Perfect Plot</h1>
          <p className="lead">
            Explore our premium collection of residential and commercial plots.
            Secure your investment today with trusted developers.
          </p>
          <Button as={Link} to="/plots" variant="primary">
            Explore Plots
          </Button>
        </Col>
        <Col md={6}>
          <Image
            src="https://images.unsplash.com/photo-1600585154340-be6161a56a0c?auto=format&fit=crop&w=900&q=80"
            fluid
            rounded
            alt="Real Estate Banner"
          />
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
